ora. PRZESTARZAŁE: zamiast tego użyj `editor_style_handles`.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'Publiczna okładzina i uchwyt w stylu edytora. PRZESTARZAŁE: Zamiast tego użyj `style_handles`.','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'Jeśli wartość jest ciągiem, zostanie użyta jako informacja o archiwum. Jeśli wartość jest fałszywa, typ treści nie ma archiwum.','The icon for the post type.'=>'Ikonka typu treści.','The slug of the template to get the fallback for'=>'Uproszczona nazwa szablonu, dla którego można uzyskać awaryjne rozwiązanie','Indicates if a template is custom or part of the template hierarchy'=>'Wskazuje, czy szablon jest własny, czy stanowi część hierarchii szablonów','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'Prefiks szablonu dla tworzonego szablonu. Służy do wyodrębnienia głównego typu szablonu np. w `taksonomia-książki` wyodrębniamy `taksonomia`','Revisions not enabled.'=>'Rewizje nie są włączone.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store musi być instancją WP_Style_Engine_CSS_Rules_Store','Whether a theme uses block-based template parts.'=>'Czy motyw używa części szablonu opartych na blokach.','Whether the theme disables generated layout styles.'=>'Czy motyw wyłącza wygenerowane style układu.','The date and time the preferences were updated.'=>'Data i godzina aktualizacji preferencji.','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'Wydaje się, że brakuje pliku %s. Jest on wymagany przed kontynuacją instalacji.','Site Name (subdirectory only):'=>'Nazwa witryny (tylko podkatalog):','Site Domain (subdomain only):'=>'Domena witryny (tylko subdomena):','Create a site or only a username:'=>'Utwórz witrynę lub tylko nazwę użytkownika:','Single i