'Edytor automatycznie podświetla składnię kodu. Można to wyłącz w <a href="%1$s" %2$s>swoim profilu%3$s</a> i pracować w trybie zwykłego tekstu.','CSS code'=>'Kod CSS','Your theme can display menus in one location.'=>'Motyw może wyświetlać menu w jednej lokacji.','Your theme can display menus in %s location.'=>'Motyw może wyświetlać menu w %s lokacji.' . "\0" . 'Motyw może wyświetlać menu w %s lokacjach.' . "\0" . 'Motyw może wyświetlać menu w %s lokacjach.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Jeśli motyw posiada kilka menu, nadanie im różnych nazw pomoże w zarządzaniu nimi.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Jeśli motyw posiada obszary przeznaczone na widżety, można również tam dodać menu. Proszę przejść do <a href="%s">Panelu widżetów</a> i dodać &#8222;widżet menu nawigacji&#8221;, aby wyświetlić menu w panelu bocznym lub stopce.','New Menu'=>'Nowe menu','Create New Menu'=>'Stwórz nowe menu','Name for the Visual editor tabVisual'=>'Wizualny','The theme defines itself as its parent theme. Please check the %s header.'=>'Motyw definiuje się jako swój motyw nadrzędny. Sprawdź nagłówek %s.','Usage of user levels is deprecated. Use capabilities instead.'=>'Używanie poziomów użytkowników jest przestarzałe. Proszę używać uprawnień.','Date'=>'Data','Month'=>'Miesiąc','Day'=>'Dzień','Time'=>'Czas','Hour'=>'Godzina','Minute'=>'Minuta','Meridian'=>'Meridian','%1$s-%2$s'=>'%1$s-%2$s','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Kliknij &#8222;Dodaj obrazek&#8221;, aby przesłać plik z komputera. Motyw działa najlepiej, jeśli obrazek odpowiada wielkości filmu &#8212; po załadowaniu obrazek będzie można przyciąć tak by idealnie pasował.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Kliknij &#8222;Dodaj obrazek&#8221;, aby przesłać plik z komputera. Motyw działa najlepiej, jeśli wielkość nagłówka obrazka wynosi %s pikseli &#8212; po załadowaniu obrazek będzie można przyciąć tak by idealnie pasował.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Kliknij &#8222;Dodaj obrazek&#8221;, aby przesłać plik z komputera. Motyw działa najlepiej, jeśli szerokość nagłówka obrazka wynosi %s pikseli &#8212; po załadowaniu obrazek będzie można przyciąć tak by idealnie pasował.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Kliknij &#8222;Dodaj obrazek&#8221;, aby przesłać plik z komputera. Motyw działa najlepiej, jeśli wysokość nagłówka obrazka wynosi %s pikseli &#8212; po załadowaniu obrazek będzie można przyciąć tak by idealnie pasował.','Select audio'=>'Wybierz plik dźwiękowy','Change audio'=>'Zmień audio','Choose audio'=>'Wybierz plik dźwiękowy','Choose image'=>'Wybierz obrazek','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Czas żeby dodać linki! Kliknij &#8222;%s&#8221; i zacznij dodawać strony, kategorie i własne odnośniki do menu. Dodawaj ile tylko chcesz.','Invalid URL.'=>'Nieprawidłowy adres URL.','Install &amp; Preview'=>'Zainstaluj i podejrzyj','Search WordPress.org theme