arów przeznaczonych na menu. ','menu locationsWhere do you want this menu to appear?'=>'Gdzie ma się pojawić to menu?','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(Jeśli planujesz użyć <a href="%1$s" %2$s>widżet%3$s</a> menu, pomiń ten krok).','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Menu pojawi się tutaj. Jeśli potrzeba zmienić jego położenie, proszę wybrać inne miejsce.','Changeset is being edited by other user.'=>'Zestaw zmian jest edytowany przez innego użytkownika.','Security check failed.'=>'Nie powiodło się sprawdzanie bezpieczeństwa.','No changeset found to take over'=>'Brak zestawu zmian do przejęcia','Sorry, you are not allowed to take over.'=>'Brak uprawnień do przejęcia edycji.','%s is already customizing this site. Do you want to take over?'=>'%s dostosowuje witrynę. Czy chcesz przejąć?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s dostosowuje witrynę. Poczekaj, aż zmiany zostaną zakończone. Twoje zmiany ustawienia zostały zapisane automatycznie.','Go back'=>'Wróć','Take over'=>'Przejmij','Could not open handle for %1$s to %2$s.'=>'Nie można otworzyć uchwytu dla %1$s do %2$s.','Create a menu for this location'=>'Utwórz menu dla tej lokalizacji','+ Create New Menu'=>'+ Dodaj menu','customizer changeset action/button labelSchedule'=>'Zaplanuj','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Kliknij &#8222;Dalej&#8221; by rozpocząć dodawanie odnośników do nowego menu.','tagsMost Used'=>'Najczęściej używane','categoriesMost Used'=>'Najczęściej używane','themeInstalled'=>'Zainstalowano','The query only expected one placeholder, but an array of multiple placeholders was sent.'=>'Zapytanie oczekiwało jednego symbolu zastępczego, a wysłano całą tablicę elementów.','Update anyway, even though it might break your site?'=>