WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Cześć!

WordPress posiada wbudowana funkcja, która wykrywa, kiedy wtyczka lub motyw powoduje błąd krytyczny w witrynie, i powiadamia za pomocą tego automatycznej wiadomości e-mail.
###CAUSE###
Proszę odwiedzić witrynę (###SITEURL###) i sprawdzić, czy nie ma żadnych widocznych problemów. Następnie odwiedzić stronę, na której został wykryty błąd (###PAGEURL###) i sprawdzić, czy nie ma widocznych problemów.

###SUPPORT### 

Jeśli witryna wygląda na uszkodzoną i nie można uzyskać dostępu do pulpitu, WordPress ma teraz specjalny „tryb odzyskiwania”. Pozwala to bezpiecznie zalogować się do pulpitu nawigacyjnego i badać ją dalej.

###LINK###

Aby zachować bezpieczeństwo witryny, ten link wygaśnie za ###EXPIRES###. Proszę się tym nie przejmować, bo nowy link zostanie wysłany, jeśli błąd wystąpi ponownie po jego wygaśnięciu.

Do rozwiązania problemu, mogą być potrzebne poniższe dane:
###DEBUG###

