można znaleźć bardziej szczegółowego szablonu (np. taksonomia: sztuka).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Wyświetla archiwum wpisów, gdy odwiedzana jest określona data (np. example.com/2023/).','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Wyświetla archiwum tagów wpisów. Szablon będzie służył jako rezerwowy, gdy nie można znaleźć bardziej szczegółowego szablonu (np. tag: pizza).','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Wyświetla się, gdy odwiedzający przegląda stronę, która istnieje dla dowolnego załącznika multimedialnego.','Displays when a visitor performs a search on your website.'=>'Wyświetla stronę wyników wyszukiwanie w witrynie.','Displays your site\'s Privacy Policy page.'=>'Wyświetla stronę polityki prywatności witryny.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Wyświetla się, gdy odwiedzający trafia na nieistniejącą stronę, na przykład niedziałający lub błędnie wpisany adres URL.','Get Involved'=>'Zaangażuj się','custom backgroundBackground'=>'Tło','custom image headerHeader'=>'Nagłówek','block categoryPatterns'=>'Wzorce','template part areaGeneral'=>'Ogólne','template part areaHeader'=>'Nagłówek','template part areaFooter'=>'Stopka','Template nameBlog Home'=>'Główna strona bloga','Template nameSingle Entries'=>'Pojedyncze treści','Template nameAll Archives'=>'Wszystkie archiwa','Template nameAuthor Archives'=>'Archiwum autora','Template nameCategory Archives'=>'Archiwum kategorii','Template nameDate Archives'=>'Archiwum daty','Template nameTag Archives'=>'Archiwum tag','Attachment Pages'=>'Strony załączników','Template nameSearch Results'=>'Wyniki wyszukiwania','Template namePage: 404'=>'Strona: 404','Expand search field'=>'Rozwiń pole wyszukiwania','The menu provided is not a valid menu.'=>'Podane menu jest nieprawidłowe','The duotone id "%1$s" is not registered in %2$s settings'=>'Identyfikator dwutonowy „%1$s” nie jest zarejestrowany w ustawieniach %2$s','No Classic Menus found.'=>'Brak klasycznych menu.','Unable to convert Classic Menu to blocks.'=>'Nie można zmienić menu klasycznego na bloki.','Title of a Navigation menuNavigation'=>'Nawigacja','Post trashed.'=>'Wpis został przeniesiony do kosza.','Page trashed.'=>'Strona została przeniesiona do kosza.','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'Nieprawidłowa strategia `%1$s` zdefiniowana dla `%2$s` podczas rejestracji skryptu.','Cannot supply a strategy `%1$s` for script `%2$s` because it is an alias (it lacks a `src` value).'=>'Nie można dostarczyć strategii `%1$s` dla skryptu `%2$s`, ponieważ jest to alias (brakuje wartości `src`).','Object ID must be an integer, %s given.'=>'Identyfikator obiektu musi być liczbą całkowitą, podano %s.','The Edit Media screen is deprecated as of WordPress 6.3. Please use the Media Library instead.'=>'Ekran edycji pliku jest przestarzały od wersji WordPress 6.3. Zamiast tego użyj biblioteki multimediów.','Footnotes'=>'Przypisy','Learn WordPress'=>'Naucz się WordPressa','Could not register file "%s" as a block pattern as the file does not exist.'=>'Nie można zarejestrować pliku „%s” jako wzorca bloku, ponieważ plik nie istnieje.','Cannot hook block to itself.'=>'Nie możesz podpiąć bloku do siebie.','Jump to footnote reference %1$d'=>'Przejdź do przypisu %1$d','Enlarge image'=>'Powiększ obrazek','Enlarge image: %s'=>'Powiększ obrazek: %s','Display a list of assigned terms from the taxonomy: %s'=>'Wyświetl listę przypisanych terminów z taksonomii: %s','Loading page, please wait.'=>'Ładowanie strony, poczekaj.','Page Loaded.'=>'Strona załadowana.','Submit Search'=>'Wyszukaj','Font font-family must be a non-empty string.'=>'Font font-family musi być niepustym ciągiem znaków.','Font src must be a non-empty string or an array of strings.'=>'Font src musi być niepustym ciągiem znaków lub tablicą ciągów znaków.','Each font src must be a non-empty string.'=>'Każdy font src musi być niepustym ciągiem znaków.','Font font-weight must be a properly formatted string or integer.'=>'Font font-weight musi być odpowiednio sformatowanym ciągiem znaków lub liczbą całkowitą.','Class %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Klasa %1$s jest <strong>przestarzała</strong> od wersji %2$s! Używaj %3$s w zamian.','Class %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Klasa %1$s jest <strong>przestarzała</strong> od wersji %2$s i nie ma dostępnej alternatywy.','The %s key must be a string without spaces.'=>'Klucz %s musi być ciągiem znaków bez spacji.','Call %s to create an HTML Processor instead of calling the constructor directly.'=>'Wywołaj %s, aby utworzyć procesor HTML zamiast bezpośredniego wywoływania konstruktora.','Please pass a query array to this function.'=>'Przekaż do tej funkcji tablicę zapytań.','block bindings sourcePattern Overrides'=>'Zastępowanie wzorców','block bindings sourcePost Meta'=>'Meta dane wpisu','Block pattern categoryVideos'=>'Filmy','Different layouts containing videos.'=>'Różne układy zawierające filmy.','Block pattern categoryAudio'=>'Dzwięki','Different layouts containing audio.'=>'Różne układy zawierające dźwięk.','[block rendering halted for pattern "%s"]'=>'[zatrzymano renderowanie bloku dla wzorca „%s”]','Block bindings source name must be a string.'=>'Nazwa źródła powiązań bloków musi być ciągiem znaków.','Block bindings source names must not contain uppercase characters.'=>'Nazwy źródeł powiązań bloków nie mogą zawierać wielkich liter.','Block bindings source names must contain a namespace prefix. Example: my-plugin/my-custom-source'=>'Nazwy źródeł powiązań bloków muszą zawierać prefiks przestrzeni nazw. Przykład: my-plugin/my-custom-source','Block bindings source "%s" already registered.'=>'Źródło powiązań bloku „%s” jest już zarejestrowane.','The $source_properties must contain a "label".'=>'$source_properties musi zawierać „label”.','The $source_properties must contain a "get_value_callback".'=>'$source_properties musi zawierać „get_value_callback”.','The "get_value_callback" parameter must be a valid callback.'=>'Parametr „get_value_callback” musi być prawidłowym wywołaniem zwrotnym.','The "uses_context" parameter must be an array.'=>'Parametr „uses_context” musi być tablicą.','The $source_properties array contains invalid properties.'=>'Tablica $source_properties zawiera nieprawidłowe właściwości.','Block binding "%s" not found.'=>'Nie znaleziono powiązania bloku „%s”.','The Site Icon is what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. It should be square and at least <code>%1$s by %2$s</code> pixels.'=>'Ikonkę witryny można zobaczyć na karcie przeglądarki, pasku zakładek oraz w mobilnej aplikacji WordPressa. Powinna być kwadratem o rozmiarze co najmniej <code>%1$s na %2$s</code> pikseli.','"%1$s" in %2$s %3$s is not a hex or rgb string.'=>'„%1$s” w %2$s %3$s nie jest ciągiem hex lub rgb.','Some required plugins are missing or inactive.'=>'Brakuje niektórych wymaganych wtyczek lub nie są one włączone.','<a href="%s">Manage plugins</a>.'=>'<a href="%s">Zarządzaj wtyczkami</a>.','Please contact your network administrator.'=>'Skontaktuj się z administratorem sieci witryn.','The first plugin requires the second plugin.%1$s requires %2$s'=>'%1$s wymaga %2$s','These plugins cannot be activated because their requirements are invalid.'=>'Wtyczki nie mogą zostać włączone, ponieważ ich wymagania nie są spełnione.','Please contact the plugin authors for more information.'=>'Skontaktuj się z autorami wtyczki, aby uzyskać więcej informacji.','No plugin specified.'=>'Nie wybrano wtyczki.','The plugin is not installed.'=>'Wtyczka nie jest zainstalowana.','The plugin has no required plugins.'=>'Wtyczka nie zawiera żadnych wymaganych wtyczek.','The following plugins must be activated first: %s.'=>'Następujące wtyczki muszą zostać aktywowane jako pierwsze: %s.','All required plugins are installed and activated.'=>'Wszystkie wymagane wtyczki są zainstalowane i aktywowane.','Missing required id key in entry among dependencies array.'=>'Brak wymaganego klucza id we wpisie w tablicy zależności.','Entries in dependencies array must be either strings or arrays with an id key.'=>'Wpisy w tablicy zależności muszą być łańcuchami lub tablicami z kluczem id.','Some of the %1$s %2$s values are invalid'=>'Niektóre z %1$s %2$s wartości są nieprawidłowe','sub item'=>'element podrzędny','Browser icon preview: Current image: %s'=>'Podgląd ikonki przeglądarki: bieżący obraz: %s','Browser icon preview: The current image has no alternative text. The file name is: %s'=>'Podgląd ikonki przeglądarki: bieżący obraz nie ma tekstu alternatywnego. Nazwa pliku to: %s','App icon preview: Current image: %s'=>'Podgląd ikonki aplikacji: bieżący obraz: %s','App icon preview: The current image has no alternative text. The file name is: %s'=>'Podgląd ikonki aplikacji: Bieżący obrazek nie ma tekstu alternatywnego. Nazwa pliku to: %s','font collection nameGoogle Fonts'=>'Google Fonts','Install from Google Fonts. Fonts are copied to and served from your site.'=>'Zainstaluj z Google Fonts. Pliki krojów są kopiowane i obsługiwane z poziomu witryny.','font categorySans Serif'=>'Krój bezszeryfowy','font categoryDisplay'=>'Wyświetlacz','font categorySerif'=>'Krój szeryfowy','font categoryHandwriting'=>'Pismo odręczne','font categoryMonospace'=>'Monospace','Font collection slug "%s" is not valid. Slugs must use only alphanumeric characters, dashes, and underscores.'=>'Uproszczona nazwa kolekcji krojów pisma  „%s” jest nieprawidłowy. Uproszczona nazwa może zawierać tylko znaki alfanumeryczne, myślniki i podkreślniki.','Font collection JSON file is invalid or does not exist.'=>'Plik JSON kolekcji krojów nie jest prawidłowy lub go brakuje.','Error decoding the font collection JSON file contents.'=>'Błąd dekodowania kolekcji krojów pisma z pliku JSON.','Error fetching the font collection data from "%s".'=>'Błąd pobierania danych kolekcji krojów pisma z „%s”.','Error decoding the font collection data from the HTTP response JSON.'=>'Błąd dekodowania danych kolekcji krojów pisma z JSON odpowiedzi HTTP.','Font collection "%1$s" has missing or empty property: "%2$s".'=>'W kolekcji krojów pisma „%1$s” brakuje właściwości lub jest ona pusta: „%2$s”.','Font collection with slug: "%s" is already registered.'=>'Istnieje już kolekcja krojów pisma o uproszczonej nazwie: „%s”.','Font collection "%s" not found.'=>'Nie znaleziono kolekcji „%s”.','Use as a `pre_render_block` filter is deprecated. Use with `render_block_data` instead.'=>'Użycie filtra `pre_render_block` jest przestarzałe. Zamiast tego użyj `render_block_data`.','`boolean` type for second argument `$settings` is deprecated. Use `array()` instead.'=>'rodzaj `boolean` dla drugiego argumentu `$settings` jest przestarzały. Zamiast tego użyj `array()`.','… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">Read more<span class="screen-reader-text">: %2$s</span></a>'=>'… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">Dowiedz się więcej<span class="screen-reader-text">: %2$s</span></a>','Block name must be a string or array.'=>'Nazwa bloku musi być ciągiem znaków lub tablicą.','https://developer.wordpress.org/advanced-administration/wordpress/css/'=>'https://developer.wordpress.org/advanced-administration/wordpress/css/','Edit %1$s (%2$s, %3$d of %4$d)'=>'Edytuj %1$s (%2$s, %3$d z %4$d)','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s)'=>'Edytuj %1$s (%2$s, submenu %3$d w %4$d pod %5$s)','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$d)'=>'Edytuj %1$s (%2$s, submenu %3$d w %4$d pod %5$s, poziom %6$d)','The %1$s filter must return an integer value greater than 0.'=>'Filtr %1$s musi zwracać liczbę całkowitą większą od 0.','Token Map tokens and substitutions must all be shorter than %1$d bytes.'=>'Mapy tokenów i ich substytuty muszą być krótsze niż %1$d bajtów.','Missing required inputs to pre-computed WP_Token_Map.'=>'Brak wymaganych danych wejściowych do wstępnie obliczonego WP_Token_Map.','Loaded version \'%1$s\' incompatible with expected version \'%2$s\'.'=>'Wczytana wersja \'%1$s\' jest niezgodna z oczekiwaną wersją  \'%2$s\'.','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$s)'=>'Edytuj %1$s (%2$s, submenu %3$d w %4$d pod %5$s, poziom %6$s)','Search themes'=>'Szukaj motywów','Categories dropdown (show_option_none parameter)None'=>'Brak','oEmbed resource link nameoEmbed (JSON)'=>'oEmbed (JSON)','oEmbed resource link nameoEmbed (XML)'=>'oEmbed (XML)','https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/'=>'https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/','https://developer.wordpress.org/advanced-administration/security/https/'=>'https://developer.wordpress.org/advanced-administration/security/https/','Interactivity directives were detected inside an incompatible %1$s tag. These directives will be ignored in the server side render.'=>'Dyrektywy interaktywności zostały wykryte wewnątrz niekompatybilnego tagu %1$s. Te dyrektywy zostaną zignorowane podczas renderowania po stronie serwera.','The namespace is required when state data is passed.'=>'Przestrzeń nazw jest wymagana, gdy przekazywane są dane stanu.','The namespace should be a non-empty string.'=>'Przestrzeń nazw powinna być niepustym ciągiem znaków.','The namespace can only be omitted during directive processing.'=>'Przestrzeń nazw może być pominięta podczas przetwarzania dyrektywy.','The context can only be read during directive processing.'=>'Kontekst może być odczytany jedynie podczas przetwarzania dyrektywy.','Interactivity directives were detected on an incompatible %1$s tag when processing "%2$s". These directives will be ignored in the server side render.'=>'Dyrektywy interaktywności zostały wykryte w niekompatybilnym znaczniku %1$s podczas przetwarzania „%2$s”.  Będą one ignorowane podczas renderowania po stronie serwera.','Interactivity directives failed to process in "%1$s" due to a missing "%2$s" end tag.'=>'Dyrektywom interaktywności nie udało się przetworzyć „%1$s” wskutek braku domykającego znacznika „%2$s”.','Namespace or reference path cannot be empty. Directive value referenced: %s'=>'Przestrzeń nazw lub ścieżka referencyjna nie mogą być puste. Wartość dyrektywy, której to dotyczy: %s','Uncaught error executing a derived state callback with path "%1$s" and namespace "%2$s".'=>'Wystąpił błąd wykonywania wywołania stanu pochodnego z użyciem ścieżki „%1$s” oraz przestrzeni nazw „%2$s”.','https://www.w3.org/WAI/tutorials/images/decision-tree/'=>'https://www.w3.org/WAI/tutorials/images/decision-tree/','The specified manifest file does not exist.'=>'Wybrany plik manifestu nie istnieje.','Template names must be strings.'=>'Nazwy szablonów muszą być ciągami znaków.','Template names must not contain uppercase characters.'=>'Nazwa bloku nie może zawierać dużych liter.','Template names must contain a namespace prefix. Example: my-plugin//my-custom-template'=>'Nazwa bloku musi zawierać prefiks przestrzeni nazw. Przykład: moja-wtyczka/mój-niestandardowy-typ-bloku','Template "%s" is already registered.'=>'Szablon „%s” jest już zarejestrowany.','Template "%s" is not registered.'=>'Szablon „%s” nie został zarejestrowany.','There has been a critical error on this website. Please check your site admin email inbox for instructions. If you continue to have problems, please try the <a href="%s">support forums</a>.'=>'W witrynie wystąpił krytyczny błąd. Instrukcje znajdziesz w skrzynce e-mail administratora witryny. Jeśli problemy będą się nadal pojawiać, skorzystaj z <a href="%s">for pomocy</a>.','The element can only be read during directive processing.'=>'Element można odczytać tylko w bezpośrednim przetwarzaniu.','Translation loading for the %1$s domain was triggered too early. This is usually an indicator for some code in the plugin or theme running too early. Translations should be loaded at the %2$s action or later.'=>'Ładowanie tłumaczenia dla domeny %1$s zostało uruchomione zbyt wcześnie. Zwykle jest to wskaźnik, że jakiś kod we wtyczce lub motywie działa zbyt wcześnie. Tłumaczenia powinny zostać załadowane podczas akcji %2$s lub później.','Posts pagination'=>'Stronicowanie wpisów','Comments pagination'=>'Stronicowanie komentarzy','Block metadata collections cannot be registered as one of the following directories or their parent directories: %s'=>'Blokowych kolekcji metadanych nie można zarejestrować jako jednego z następujących katalogów ani ich katalogów nadrzędnych: %s']];